import React from 'react'
import { Accordion, AccordionItem, AccordionItemButton, AccordionItemHeading, AccordionItemPanel } from 'react-accessible-accordion';
 const WEEK_DAYS = ['Monday', 'Tuesday', 'Wednesday', 'Thursday', 'Friday', 'Saturday', 'Sunday'];
const Forecast = ({data}) => {
  const dataInAWeek=new Date().getDay();
  const forecastDays=WEEK_DAYS.slice(dataInAWeek,WEEK_DAYS.length)
  .concat(WEEK_DAYS.slice(0,dataInAWeek)
  )
  // console.log(forecastDays)
  return (
    <>
      <label className="title">Daily</label>
      {/* <h1>{console.log("$$$$$$$$$$$$$$$$$")}</h1>
      <h1>{console.log(data)}</h1>
      <h1>{console.log("$$$$$$$$$$$$$$$$$")}</h1> */}
       <Accordion allowZeroExpanded>
        {data.list.splice(0, 7).map((item, idx) => (
          <AccordionItem key={idx}>
            <AccordionItemHeading>
              <AccordionItemButton>
                <div className='daily-item'>
               <img src={`icons/${item.weather[0].icon}.png`} alt="weather" className='icon-small' />
               <label className='day'>{forecastDays[idx]}</label>
                </div>
              </AccordionItemButton>
            </AccordionItemHeading>
            <AccordionItemPanel>
            <div className="daily-details-grid">
                <div className="daily-details-grid-item">
                  <label>Pressure:</label>
                   <label>{item.main.pressure}</label>
                 </div>
                <div className="daily-details-grid-item">
                  <label>Humidity:</label>
                   <label>{item.main.humidity}</label>
                 </div>
                 <div className="daily-details-grid-item">
                  <label>Clouds:</label>
                   <label>{item.clouds.all}%</label>
                 </div>
                 <div className="daily-details-grid-item">
                   <label>Wind speed:</label>
                   <label>{item.wind.speed} m/s</label>
                 </div>
                 <div className="daily-details-grid-item">
                   <label>Sea level:</label>
                   <label>{item.main.sea_level}m</label>
                 </div>
                 <div className="daily-details-grid-item">
                  <label>Feels like:</label>
                  <label>{item.main.feels_like}°C</label>
                </div>
               </div>
            </AccordionItemPanel>
          </AccordionItem>
        ))}
      </Accordion>

    </>
  )
}

export default Forecast;
